column8:
2007年の600年に一度の金豚の年以来、日本でもまだまだ金豚ブームが続いています。中国では古来、豚は魔よけのシンボルとしてあがめられてきましたが、時につれ家畜化が進むとその財産的価値から次第に富裕のシンボルとして、考えられるようになりました。<br>
本商品は20インチの巨大金豚貯金箱です。つぶらな瞳は飾っているだけで運が寄ってきそうな可愛らしさです。可愛いのでついつい背中のスリットにお金を入れてしまいたくなり、どんどんお金が貯まります。おなかに書かれている変な漢字は【招財進寶】（しょうざいしんぽう）という組み文字で「財を招いて宝に進む」と言う意味があります。中華料理店などの店舗装飾や最近ではドラマやバラエティーなどの小道具としても大変人気が有ります。</p>
<p><b>【商品詳細】</b><br>
・サイズ　43cm×38cm×高さ35cm<br>
・重量　約6000g<br>
・陶器製<br>
・中国製<br>
・底面のシールはオレンジまたは黒になります<br>
<b><font color=red >※ほとんどの金豚貯金箱に共通ですが、若干の塗りムラがございます。予めご了承頂けます様お願い致します。<br>
※赤い塗料が手に付着する場合がございます。洋服などに付かないようご注意下さい。</font></b></p><style type="text/css">
